import React from 'react';
import { Card } from 'react-bootstrap';

class MainContent extends React.Component {
  render() {
    return (
      <div>
        <div className="mainContentbg">
          {/* <div className="container"> */}
          <div className="row">
            <div className="col-6 p-0">
              <Card className="bg-dark text-white">
                <Card.Img
                  src="https://images.unsplash.com/photo-1615869442289-f35f5173db8d?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=1492&q=80"
                  alt="Card image"
                />
                <Card.ImgOverlay>
                  <Card.Title>Card title</Card.Title>
                  <Card.Text>
                    This is a wider card with supporting text below as a natural
                    lead-in to additional content. This content is a little bit
                    longer.
                  </Card.Text>
                  <Card.Text>Last updated 3 mins ago</Card.Text>
                </Card.ImgOverlay>
              </Card>
            </div>
            <div className="col-sm-6">
              <div className="row">
                <img src="https://images.unsplash.com/photo-1555532538-dcdbd01d373d?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1431&q=80" alt="" />
              </div>
            </div>
          </div>
          {/* </div> */}
        </div>
      </div>
    );
  }
}

export default MainContent;
